import React from "react"
import NavBar from "./components/NavBar"

export default function App() {
    const date = new Date()
    const hours = date.getHours() % 12
    return (
        <div className="container">
            <NavBar />
            <h1>It is currently about {hours} o'clock!</h1>
        </div>
    )
}
